// @mui material components
import Card from "@mui/material/Card";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import DataTable from "examples/Tables/DataTable";
import MiniStatisticsCard from "examples/Cards/StatisticsCards/MiniStatisticsCard";
import Grid from "@mui/material/Grid";
// import { Table } from 'react-bootstrap';
// Data
import { Link } from "react-router-dom";
import datatable from "layouts/authentication/error/datatable";
import datatable1 from "layouts/authentication/error/datatable1";
import datatable2 from "layouts/authentication/error/datatable2";


function DataTables() {
  return (
    <DashboardLayout>
      <DashboardNavbar />

      <SuiBox pt={6} pb={3}>
        <SuiBox py={3}>
          <SuiBox mb={4}>
            <Grid container spacing={3}>
              <Grid item xs={12} sm={6} lg={2.4}>
                <MiniStatisticsCard
                  // title={{ text: "Total AUM", fontWeight: "bold", color: "black" }}
                  count="15.43 Cr"
                  percentage={{ color: "success", text: "" }}
                  icon={{ color: "", component: "" }}
                > <Link to="/authentication/error/anurag">Total AUM</Link></MiniStatisticsCard>
              </Grid>
              <Grid item xs={12} sm={6} lg={2.4}>
                <MiniStatisticsCard
                  title={{ text: "Total Purchase", fontWeight: "medium" }}
                  count="25.65 Cr"
                  percentage={{ color: "success", text: "" }}
                  icon={{ color: "", component: "" }}
                />
              </Grid>
              <Grid item xs={12} sm={6} lg={2.3}>
                <MiniStatisticsCard
                  title={{ text: "Total Redemption", fontWeight: "medium" }}
                  count="
              13.95 Cr"
                  percentage={{ color: "success", text: "" }}
                  icon={{ color: "", component: "" }}
                />
              </Grid>
              <Grid item xs={12} sm={6} lg={2.3}>
                <MiniStatisticsCard
                  title={{ text: "PTotal Clients", fontWeight: "medium" }}
                  count="963"
                  percentage={{ color: "success", text: "" }}
                  icon={{ color: "", component: "" }}
                />
              </Grid>
              <Grid item xs={12} sm={6} lg={2.6}>
                <MiniStatisticsCard
                  title={{ text: "Running SIPs At Bse", fontWeight: "medium" }}
                  count="44"
                  percentage={{ color: "success", text: "" }}
                  icon={{ color: "", component: "" }}
                // backgroundColor="#e6f3ff;"
                />
              </Grid>
            </Grid>
          </SuiBox>
        </SuiBox>
        <SuiBox mb={3}>
          <Card>
            <SuiBox p={3} lineHeight={1}>
              <SuiTypography variant="h5" fontWeight="medium">

                TOP AMC AUM
              </SuiTypography>
              {/* <SuiTypography variant="button" fontWeight="regular" textColor="text">
                A lightweight, extendable, dependency-free javascript HTML table plugin.
              </SuiTypography> */}
            </SuiBox>
            <DataTable table={datatable} />
          </Card>
        </SuiBox>
        <Card>
          <SuiBox p={3} lineHeight={1}>
            <SuiTypography variant="h5" fontWeight="medium">
              TOP INVESTORS AUM
            </SuiTypography>
            {/* <SuiTypography variant="button" fontWeight="regular" textColor="text">
              A lightweight, extendable, dependency-free javascript HTML table plugin.
            </SuiTypography> */}
          </SuiBox>
          <DataTable table={datatable1} canSearch />
        </Card>


        <Card>
          <SuiBox p={3} lineHeight={1}>
            <SuiTypography variant="h5" fontWeight="medium">
              CURRENT MONTH SNAPSHOT
            </SuiTypography>
            {/* <SuiTypography variant="button" fontWeight="regular" textColor="text">
              A lightweight, extendable, dependency-free javascript HTML table plugin.
            </SuiTypography> */}
          </SuiBox>
          <DataTable table={datatable2} />

        </Card>

      </SuiBox>
      <Footer />
    </DashboardLayout>
  );
}

export default DataTables;
